迭代器(Iterable)
概述

迭代之前需要实现知道如何使用数据结构,不适用于所有的数据结构
遍历顺序并不是数据结构固有的，不适用于具有隐式顺序的数据结构
可迭代数据类型字符串，数组，映射，集合，arguments对象，NodeList对象
实际编写,不需要显式使用Iterator，因为for-of循环,数组解构,扩展运算符,Array.from,map/set，map方法等都可以接受的可迭代对象
迭代器的原理其实是调用Symbol.iterator方法，返回一个可迭代的对象

 // it此时为一个迭代器(iterator)
  let arr = [1, 2, 3, 4]
  let it = arr[Symbol.iterator]()
  let current = it.next()
  while (!current.done) {
    console.log(current.value)
    current = it.next()
  }

NodeList对象也支持迭代器遍历
    let a = document.getElementsByTagName('div')
    let current = [...a]

类数组对象：给对象增加Symbol.iterator方法，因为对象默认不可以遍历，所以借用Array原型链的方法
  let c = {
    0: 'a',
    1: 'c',
    length: 2,
    [Symbol.iterator]: Array.prototype[Symbol.iterator]
  }

  for (let i of c) {
    console.log(i)  // a c
  }

覆盖原生的iterator的行为

任意对象的Symbol.iterator的方法，等于该对象的遍历器的生成函数，调用该函数会返回该对象的一个遍历器对象

这里使用new String因为要用引用类型，而不能使用原始类 let str = '123',因为一个是引用类型，一个是原始类型，原始类型存在内存栈当中，引用类型存在内存堆当中


重写生成器
  let str = new String('123')
  console.log([...str])
  str[Symbol.iterator] = function () {
    return {
      next: function () {
        if (this.first) {
          this.first = false
          return {
            value: 'bye',
            done: false
          }
        } else {
          return {
            value: undefined,
            done: true
          }
        }
      },
      first: true
    }
  }
  console.log([...str]) // bye

使对象支持生成器

  let obj = {}

  obj[Symbol.iterator] = function* () {
    yield 1;
    yield 2;
    yield 3;
  }

  console.log([...obj])  // [1,2,3]

