生成器(generator)
yield表达式

遇到yield表达式，就暂停执行后面的操作，并将紧跟在yield后面的那个表达式，作为返回对象的值

下一次调用next方法，再继续往下执行，直到遇到下一个yield表达式。

如果没有遇到新的yield表达式就一直运行到函数结束，直到return语句为止，并将return语句后面的表达式，作为返回对象的value属性值

如果该函数没有return语句，则返回的对象的value属性值为undefined



生成器函数执行后，返回一个遍历器对象，该对象也具有Symbol.iterator属性，执行后返回自身

    function* gen () { }

    let g = gen()

    console.log(g[Symbol.iterator]() === g)  //true

   // 生成器
   function* generatorFn(){
     console.log(123)
     yield '123'
   }
   let result = generatorFn() // 迭代器
   result.next()   // 这里输出123 同时执行迭代器

   // 产生可迭代对象
  function* Iterato () {
    yield* [1, 2, 3]
    yield* [4, 5, 6]
  }
  let a = Iterato()
  for (let i of a) {
    console.log(i)  // 1,2,3,4,5,6
  }


  // 最有用的递归操作
  function* Times (n) {
    if (n > 0) {
      yield* Times(n - 1)
      yield n - 1
    }
  }

  for (let i of Times(5)) {
    console.log(i)  // 0 1 2 3 4
  }


  // 提前终止生成器
  function* generatorFn () {
    yield '1';
    yield '2';
    yield '3';
  }
  let f = generatorFn()

  console.log(f.next())  // {value:1,done:false}
  console.log(f.return(4))  //  {value:4,done:true}

Generator.prototype.throw()
throw()方法可以在生成器内部中捕获，也可以在生成器外部捕获，如果内部外部都无try/catch方法则报错
throw()方法抛出的错误要被内部捕获，前提是要执行一次next方法
执行throw()方法会附带执行下一条yield表达式
一旦Generator执行过程中抛出错误，且没有内部捕获，Generator就会进入执行完毕的状态
    function* generFn(){
      try {
        yield 123
      } catch (error) {
        console.log('内部捕获',error)  // 内部捕获 a
      }
    }
    let a = generFn()
    a.next()
    a.throw('a')

Generator.return()
return()方法可以携带参数，一旦执行生成器进入执行完毕的状态
yield* 表达式
在当前的生成器当中执行另一个生成器，类似于解构
  function* foo(){
    yield 1;
    yield 2;
  }

  function* boo(){
    yield 0;
    yield* foo()
  }

  for(let i of boo()){
    console.log(i)  // 0 1 2
  }

任何数据只要有Iterator接口就可以被yield* 遍历
  function* foo(){
    yield* [1,2,3]
  }
  for(let i of foo()){
    console.log(i)  // 1 2 3
  }

yield* 版本的数组扁平化
  function *foo(array){
    if(Array.isArray(array)){
    for(let i=0;i
生成器实现斐波那锲数列
  function* fibonacci(){
    let [prev,cur] = [0,1]
    for(;;){
      yield cur;
      [prev,cur] = [cur,prev+cur]
    }
  }

  for(let i of fibonacci()){
      if(i > 500) break;
       console.log(i)
  }

docs/object.html.body:
对象
object.defineProperty：设置对象的数据属性和访问器属性，隐式的给对象添加属性
数据属性
configurable:默认false，属性不可以被删除
Enumerable:默认false，属性不可以被遍历
writable:默认false，属性的值不可以被重写
value:默认undefined，属性的值
  var obj = {}
  Object.defineProperty(obj, 'a', {
    value: '3',
    configurable: false,
    enumerable: false,
    writable: false
  })

访问器属性
get()：获取对象属性的值
set()：设置对象属性的值

  var obj = {
    _a: 123
  }
  Object.defineProperty(obj, 'a', {
    get () {
      return this._a
    },
    set (newVal) {
      this._a = newVal
    }
  })
  obj.a  // 123

Object.defineProperties：一个对象上添加设置多个属性
  let obj = {}
  Object.defineProperties(obj, {
    year: {
      value: 123
    },
    name: {
      get () {
        return '常成'
      }
    }
  })
  obj.year // 123
  obj.name // 常成

Object.getOwnPropertyDescriPtor()：获取指定属性的属性描述符
   let objDesc = Object.getOwnPropertyDescriptor(obj, 'year')
    { 
      value: 123,
      writable: false,
      enumerable: false,
      configurable: false
    }

Object.getOwnPropertyDescriptions()：返回指定对象全部的属性描述符
  let objDesc = Object.getOwnPropertyDescriptions(obj)
   { 
   year:{ 
     value: 123,
     writable: false,
     enumerable: false,
     configurable: false
   },
   name:{ 
     get: [Function: get],
     set: undefined,
     enumerable: false,
     configurable: false } 
  }

Object.assign()：对象的浅复制合并,接收一个对象或者多个对象
  let a = { name: 'a' }
  let b = { name: 'cc' }
  let result = Object.assign(a, b) // {name:'cc'}
  result === a // true
  result === b // false

Object.is()：对象的相等判定，解决NaN不相等以及+0，-0的问题
   +0 == -0  //true
   Object.is(+0, -0) //false
   Object.is(NaN,NaN)  //true

解构赋值
  let { name: personName, age: personAage } = obj
  personName // cc
  personAage // 26

Object.hasOwnProperty()：方法会返回一个布尔值，指示对象自身属性中是否具有指定的属性（也就是，是否有指定的键）

  Object.hasOwnProperty('name') //true Object本身就有name属性

  function Create () { }
  Create.prototype.say = 'name'
  let a = new Create()
  a.name = 'cc'
  a.hasOwnProperty('name') // ture 实例a本身就有name属性
  a.hasOwnProperty('say') // false say方法是从原型链上获得，所以为false

  for (let i in a) {
    if (a.hasOwnProperty(i)) {
         console.log(i)   // 这里只打印name而不打印say
    }
  }

Object.keys():方法会返回一个由一个给定对象的自身可枚举属性组成的数组，数组中属性名的排列顺序和正常循环遍历该对象时返回的顺序一致 。

  function Create () { }
  Create.prototype.say = 'name'
  let a = new Create()
  a.name = 'cc'
  Object.keys(a) // ['name']

Object.getOwnPropertyNames():方法返回一个由指定对象的所有自身属性的属性名（包括不可枚举属性但不包括Symbol值作为名称的属性）组成的数组

  function Create () { }
  Create.prototype.say = 'name'
  let a = new Create()
  a.name = 'cc'
  console.log(Object.getOwnPropertyNames(Create.prototype)) // [ 'constructor', 'say' ]

Object.getOwnPropertySymbols():方法返回一个给定对象自身的所有 Symbol 属性的数组。
    let a = Symbol('k1')
    let b = Symbol('k1')

    let obj = {
      [a]: 1,
      [b]: 2
    }
    console.log(Object.getOwnPropertySymbols(obj))  // [ Symbol(k1), Symbol(k1) ]

Object.values():方法返回一个给定对象自身的所有可枚举属性值的数组，值的顺序与使用for...in循环的顺序相同 ( 区别在于 for-in 循环枚举原型链中的属性 )。
Object.entries():方法返回一个给定对象自身可枚举属性的键值对数组，其排列与使用 for...in 循环遍历该对象时返回的顺序一致（区别在于 for-in 循环还会枚举原型链中的属性）。
    let obj = {
      a: 1,
      b: 2,
      c: 3
    }
    console.log(Object.keys(obj))  // [ 'a', 'b', 'c' ]
    console.log(Object.entries(obj)) // [ [ 'a', 1 ], [ 'b', 2 ], [ 'c', 3 ] ]

docs/class.html.body:
类
new的实现原理
1.在内存当中创建一个新对象
2.这个新对象的内部的prototype被赋值为构造函数的prototype
3.构造函数内部的this被赋值为这个新对象
4.执行构造函数内部的代码，给新对象添加属性
5.如果构造函数返回非空对象，则返回该对象，否则返回刚创建的新对象
  function create (fn) {
    let proto = new Object()
    proto.__proto__ = Object.create(fn.prototype)
    fn.call(proto)
    return proto
  }

理解原型
  function Person(){}
  let peson1 = new Person()
  let person2 = new Person()
  Person.prototype.__proto__ === Object.prototype; // true 
  Person.prototype.__proto__.constructor === Object; // true 
  Person.prototype.__proto__.__proto__ === null; // true
  // 同一个构造函数生成的两个实例，共享一个原型对象
  person1.__proto__ === person2.__proto__; // true
  console.log(Person.prototype.__proto__)
  // { 
  //   constructor: f Object(), 
  //   toString: ... 
  //   hasOwnProperty: ... 
  //   isPrototypeOf: ... 
  //   ... 
  // }

Object.prototype.isPrototypeOf():测试一个对象是否存在于另一个对象的原型链上
  function Bar(){}
  let bar = new Bar()
  Bar.prototype.isPrototypeOf(bar)  //true

Object.getPrototypeOf():返回参数的prototype的值
    function Bar () { }
    Bar.prototype.name = '213'
    let bar = new Bar()
   Object.getPrototypeOf(bar)  // {name:'213'}

setPrototypeOf(obj,prototype):向实例的私有对象prototype写入一个新值
Object.setPrototypeOf()修改继承关系影响深远，会涉及所有访问那些改过prototype对象的代码，可以通过Object.create()创建一个新对象的原型对象来降低影响

  let obj = {
    name: 123
  }

  let stay = {
    name: 123,
    c: 'ddd'
  }
  stay.__proto__.sayName = function(){
    console.log('name')
  }
  // 影响深远，因为会延着原型链向上查找
  Object.setPrototypeOf(obj, stay)
  // 通过Object.create()创建一个新对象，并且为其指定原型
  let person = Object.create(stay)
  person.c  //'ddd'
  person.sayName() // 'name'

Object.isPrototypeOf:是否包含这个原型
    function SuberType () { }
    let instance = new SuberType()
    console.log(Object.prototype.isPrototypeOf(instance)) // true

Es6类
Es6类没有函数声明提升，Es5函数作为定义可以
函数受作用域限制，类受块作用域限制
Es6类包括构造函数方法,实例方法，获取函数，设置函数，静态类方法
实例化
new的操作过程
1.在内存中创建一个新对象。
2.这个新对象内部的[[Prototype]]指针被赋值为构造函数的 prototype 属性。
3.构造函数内部的 this 被赋值为这个新对象（即 this 指向新对象）。
4.执行构造函数内部的代码（给新对象添加属性）。
5.如果构造函数返回非空对象，则返回该对象；否则，返回刚创建的新对象。
class Person {
  // 私有属性
  constructor(age) {
    this.age = age
  }
  // 原型链方法
  sayAage () {
    console.log(this.age)
  }
  // 类的私有方法
  static setAge () {
    return new Person(Math.random())
  }
}

let a = Person.setAge()

类的默认迭代器
class Person { 
 constructor() { 
  this.nicknames = ['Jack', 'Jake', 'J-Dog']; 
 } 
 // 将Person改变为一个可迭代对象
  *[Symbol.iterator]() { 
    yield *this.nicknames.entries(); 
  } 
} 
let p = new Person(); 
for (let [idx, nickname] of p) { 
 console.log(nickname); 
}

类的继承
继生类中可以通过super继承引用父类的原型，在构造函数当中使用super可以调用父类的构造函数，在ES5中相当于call()之类的方法，改变this指针，继承父类构造函数当中的方法和属性
super只能在派生类构造函数和静态方法中使用
不能单独引用super关键词，要用它调用构造函数，要么用它引用静态方法
调用super()会调用父类构造函数，并将返回的实例赋值给this
super()的行为如同调用构造函数，如果需要给父类构造函数传参，则需要手动传入
如果没有定义类构造函数，在实例化派生类时调用super()，而且会传入所有传给派生类的参数
在类构造函数中，不能调用super()之前引用this
如果在派生类中显式的定义了构造函数，要么必须在其中调用super，要么必须在其中返回一个对象

 class SuperType {
  constructor() {
    this.name = '123'
  }
  sayName () {
    console.log('SuperType')
  }
}

class Suber extends SuperType {
  constructor() {
    super()
  }
  getName () {
    super.sayName()
  }
}

let instance = new Suber()
instance.getName()

docs/instance.html.body:
Js的六种继承
一.原型链继承
特点：因为SubType.prototype直接设置为SuperType函数的实例，这样一来，SubType生成实例不仅能获取SuperType实例中的属性，还能与SuperType.prototype挂上钩
缺点：1.新实例无法向父类构造函数传参 
2.继承单一 
3.所有的实例属性和方法都是通用的,无法实现属性和方法的私有

function SuperType() { 
 this.colors = ["red", "blue", "green"]; 
} 
function SubType() {} 
// 继承 SuperType 
SubType.prototype = new SuperType(); 

let instance1 = new SubType(); 
instance1.colors.push("black"); 
console.log(instance1.colors); // "red,blue,green,black" 

let instance2 = new SubType(); 
console.log(instance2.colors); // "red,blue,green,black"

 二.借用构造函数继承
特点：可以向父类构造函数传参，用call或者apply将父类构造函数引入子类函数（在子类函数中做了父类函数的自执行（复制））,可以实现属性的私有
缺点：无法继承原型链属性
function SuperType() { 
 this.colors = ["red", "blue", "green"]; 
} 
function SubType() { 
  // 继承 SuperType 
  SuperType.call(this); 
} 
let instance1 = new SubType(); 
instance1.colors.push("black"); 
console.log(instance1.colors); // "red,blue,green,black" 
let instance2 = new SubType(); 
console.log(instance2.colors); // "red,blue,green"

 三.组合继承(原型继承+借用构造函数继承)
 特点：结合了两种的优点，可以实现属性的私有化
 缺点：但是调用了两次父类构造函数，一次是创建子类原型，一次是在子类构造函数调用
    function SuperType(name){ 
        this.name = name; 
        this.colors = ["red", "blue", "green"]; 
    } 
    SuperType.prototype.sayName = function() { 
        console.log(this.name); 
    }; 
    function SubType(name, age){ 
        // 继承属性
        SuperType.call(this, name); 
        this.age = age; 
    } 
    //这里会导致SubType.prototype.constructor是SuperType
    SubType.prototype = new SuperType(); 
    SubType.prototype.sayAge = function() { 
        console.log(this.age); 
    }; 

    let instance1 = new SubType("Nicholas", 29); 
    instance1.colors.push("black"); 
    console.log(instance1.colors); // "red,blue,green,black" 
    instance1.sayName(); // "Nicholas"; 
    instance1.sayAge(); // 29 

    let instance2 = new SubType("Greg", 27); 
    console.log(instance2.colors); // "red,blue,green" 
    instance2.sayName(); // "Greg"; 
    instance2.sayAge(); // 27

四.原型式继承
特点：不定义类型也能通过原型实现对象之间的信息共享，创建临时函数，将传入的对象，赋值函数的原型对象，返回一个新对象
缺点：没有构造函数的场景
function object (o) {
  function F () { }
  F.prototype = o;
  return new F();
}
let person = {
  name: "Nicholas",
  friends: ["Shelby", "Court", "Van"]
};
let anotherPerson = object(person);
anotherPerson.name = "Greg";
anotherPerson.friends.push("Rob");

let yetAnotherPerson = object(person);
yetAnotherPerson.name = "Linda";
yetAnotherPerson.friends.push("Barbie");
console.log(person.friends); // "Shelby,Court,Van,Rob,Barbie"

// 只有一个参数时，Object.create()方法与object方法效果是一样的
let obj = Object.create(person)
console.log(obj.name)  // "Nicholas"

五、寄生式继承
特点：创建一个实现继承的函数，以某种方式增强对象，然后返回这个对象，实际上是在原型式继承的基础上可以对返回的新对象可以进行操作
缺点：没有构造函数场景
// 返回一个对象
function object (o) {
  function F () { }
  F.prototype = o;
  return new F();
}

// 寄生继承函数
function createAnother (original) {
  let clone = object(original)
  clone.say = function () {
    console.log('Hi')
  }
  return clone
}

let Person = {
  name: 'person'
}
let anotherPerson = createAnother(Person)
anotherPerson.say()  // Hi
console.log(anotherPerson.name)  // Person

六、寄生组合式继承
特点：解决组合继承的两次调用问题

传入子类构造函数和父类构造函数
创建父类原型的一个副本
给返回的副本设置正确的constructor属性
将副本赋值给子类的原型

// 唯一的核心，相对于组合继承，不用再调用SuperType()而是直接创建父的原型对象的新对象，直接关联父的原型对象
function inheritPrototype(subType, superType) { 
  let prototype = object(superType.prototype); // 创建对象
  prototype.constructor = subType; // 增强对象
  subType.prototype = prototype; // 赋值对象
}

function SuperType(name) { 
 this.name = name; 
 this.colors = ["red", "blue", "green"]; 
} 
SuperType.prototype.sayName = function() { 
 console.log(this.name); 
}; 
function SubType(name, age) { 
 // 这里拷贝父函数的私有属性
 SuperType.call(this, name);
 this.age = age; 
} 
inheritPrototype(SubType, SuperType); 
SubType.prototype.sayAge = function() { 
 console.log(this.age); 
};

