接口一方面可以在面向编程中表示行为的抽象，另外可以用来表示对象的形状
接口就是把一些类中的共有属性和方法抽象出来，可以用来约束实现此接口的类
一个类可以继承另一个类并实现多个接口
接口像插件一样用来增强类，而抽象类是具体类的抽象
一个类可以有实现多个接口，一个接口也可以被多个类实现，但一个类可以有多个子类，但只能有一个父类
